# ## 2.4 Calling the API

# + id="ZIJRSBhRGBUF"
# executes a GET request on the API
def call_API(
    access_token: str,
    url: str,
    call: str = "GET"
):
    headers = {
        "Authorization": "Bearer " + access_token
    }
    return requests.request(
        call, url=url, headers=headers).json()


