# + [markdown] id="fEzBJBzTUvG4"
# # 8. Outlier Detection and Data Cleaning
#
#

# + [markdown] id="fTwDu3oifh4t"
# Detecting outliers is a uselful thing to do before an analysis which is evident from the datapoint shown in section 4.1 where the device was worn for a very little time. Data points like this may affect the results of a data analysis done on the data that contain them. There are multiple ways of annotating outliers and here we are going to present two of them: method 1, method 2.  

# + [markdown] id="vR8yG6akLC3G"
# We find outliers and remove them in order to get better analysis accuracy by removing the possibility of measurement errors, but at the same time it can affect the result's accuracy since some outliers are true outliers: outliers that is important in the data itself. See [Gress et al., 2018] to learn more about the effects of removing outliers.
#
# ### 8.1 First Way to Detect Outliers: Iterquartile range
#
# According to the [National Institute of Standards and Technology's handbook](https://https://www.itl.nist.gov/div898/handbook/prc/section1/prc16.htm#:~:text=An%20outlier%20is%20an%20observation,what%20will%20be%20considered%20abnormal.), we assume that a "mild outlier" is a datapoint that is higher than or lower than the first quartile or higher than the third quartile by a distance of the interquartile range multiplied by 1.5 points, while "extreme outliers" are ones that distance multipled by 3 points instead. Lets create a function that applies this on a given array.
#
# Quartiles are the values that divide a list of numbers into quarters, and the "Interquartile Range" is from Q1 to Q3. We check if:
#
# point >= Q3 + (1.5 * interquartile_range)
#
# or
#
# point <= Q1 - (1.5 * interquartile_range)
#

# + id="gctkjYGsLhmK"
def interquartile(array):
    #find interquartile range
    quartiles = np.quantile(array, [0.25,0.75])
    q1, q3 = quartiles[0],quartiles[1]
    interquartile_Range = q3 - q1

    #append outliers
    outliers = []
    for item in array:
        if item >= q3+(1.5* interquartile_Range) or item <= q1 - (1.5*interquartile_Range):
            outliers.append(item)
    return outliers


